import { Provider } from 'react-redux';
import store from './store';
import { useApp } from './useApp';

import ChannelList from './components/ChannelList';

function App() {

  const { fetchEpg } = useApp();

  return (
    <Provider store={store}>
      <h1 className="text-3xl font-bold">
        Hello world!
        <ChannelList />
      </h1>
    </Provider>
  );
}

export default App;
